      if (!console)
        console = {
          log: function() {},
          error: function() {},

            "requirejs": "requirejs/build/convert/commonjs",
            "wmsy": "wmsy/lib/wmsy",
          },
        },
        ["requirejs/global-es5", "wmsy/examples/testresults-show"],
        function(es5, mainModule) {
          mainModule.main();
        }
      );
    </script>
